import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
export default function CreateProject() {
    const [employees, setEmployees] = useState([]);
    const [pManagers, setPManagers] = useState([]);

    useEffect(() => {
        getemployees();
        getManagers();

    }, []);

    function getemployees() {
        fetch("http://localhost:4000/api/Employee/employeeForProject")
            .then(response => {
                if (response.ok) {
                    return response.json()
                }
                throw new Error()
            })
            .then(data => {
                // console.log(data)
                setEmployees(data)
            })
            .catch(error => {
                alert("Unable to get the data")
            })
    }
    function getManagers() {
        fetch("http://localhost:4000/api/Employee/projectManager")
            .then(response => {
                if (response.ok) {
                    return response.json()
                }
                throw new Error()
            })
            .then(data => {
                // console.log(data)
                setPManagers(data)
            })
            .catch(error => {
                alert("Unable to get the data")
            })
    }

    return (
        <div className="container my-4">
            <div className="row">
                <div className="col-md-8 mx-auto rounded border p-4">

                    <h2 className="text-center mb-5">Create Project</h2>

                    <form>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">First Name</label>
                            <div className="col-sm-8">
                                <input className="form-control" name="name" />
                                <span className="text-danger"></span>
                            </div>
                        </div>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">Name</label>
                            <div className="col-sm-8">
                                <input className="form-control" name="lastName" />
                                <span className="text-danger"></span>
                            </div>
                        </div>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">Customer Company</label>
                            <div className="col-sm-8">
                                <input className="form-control" name="middleName" />
                                <span className="text-danger"></span>
                            </div>
                        </div>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">Executor Company</label>
                            <div className="col-sm-8">
                                <input className="form-control" name="executorCompany" />
                                <span className="text-danger"></span>
                            </div>
                        </div>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">Priority</label>
                            <div className="col-sm-8">
                                <input className="form-control" name="priority" />
                                <span className="text-danger"></span>
                            </div>
                        </div>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">Start Date</label>
                            <div className="col-sm-8">
                                <input className="form-control" name="startDate" />
                                <span className="text-danger"></span>
                            </div>
                        </div>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">End Date</label>
                            <div className="col-sm-8">
                                <input className="form-control" name="endDate" />
                                <span className="text-danger"></span>
                            </div>
                        </div>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">Project Manager</label>
                            <div className="col-sm-8">
                                <select className="form-select" name="projectManagerFromEmployees">
                                    {
                                        pManagers.map((pManagers, index) => {
                                            <option key={pManagers.id} value={pManagers.id}>
                                                {pManagers.firstName} {pManagers.position}
                                            </option>
                                        })
                                    }
                                </select>
                            </div>
                        </div>
                        <div className="row mb-3">
                            <label className="col-sm-4 col-form-label">Employees</label>
                            <div className="col-sm-8">
                                <select className="form-select" name="employee">
                                    {
                                        employees.map((employee, index) => {
                                            console.log(employee)
                                            return (
                                                <option key={employee.id} value={employee.id}>
                                                    {employee.firstName} {employee.position}
                                                </option>
                                            )
                                        })
                                    }

                                </select>

                            </div>
                        </div>
                    </form>

                </div>

            </div>
        </div>
    )
}
